window.bookSummaryJSON = "<p>Born into hell. Baptism by betrayal.&nbsp;</p> <p>His life revolves around violence. My life is on the line.&nbsp;</p> <p>I'm trapped both physically and emotionally. A pawn in a game I didn't know I was playing. Until I met him.&nbsp;</p> <p>Pike acts without emotion, but I know he feels something for me. I see it in his eyes when he looks at me. I feel it when he's close. I know it's real because I feel it too. Lust. Desire. It complicates everything.&nbsp;&nbsp;</p> <p>I know that I'm part of Pike's plan for revenge. He doesn't know he's part of mine.&nbsp;&nbsp;</p> <p>Contains mature themes.</p>"; 
